import React from 'react';
import Head from 'next/head';
import 'antd/dist/antd.css';
import PropTypes from 'prop-types';

const App = ({ Component }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <div>공통 메뉴</div>
        <Component />
      </Head>
    </>
  );
};

App.prototypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
